import React, { useEffect } from "react";
import { useParams } from "react-router-dom";

const Detail = () => {
    const { id } = useParams();

    useEffect(() => {
        document.title = `Detail - ID: ${id}`;
    }, [id]);

    return (
        <div>
            <h1>Detail</h1>
            <p>ID: {id}</p>
        </div>
    );
};

export default Detail;
